attributes":{"coordinates":null,"data_source":{"id":"46397"},"glyph":{"id":"46595"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"46597"},"nonselection_glyph":{"id":"46596"},"view":{"id":"46599"}},"id":"46598","type":"GlyphRenderer"},{"attributes":{"axis":{"id":"46548"},"coordinates":null,"grid_line_color":"#FFFFFF","grid_line_width":0.75,"group":null,"ticker":null},"id":"46551","type":"Grid"},{"attributes":{"source":{"id":"46397"}},"id":"46581","type":"CDSView"},{"attributes":{"tools":[{"id":"46490"},{"id":"46491"},{"id":"46492"},{"id":"46493"},{"id":"46494"},{"id":"46495"}]},"id":"46497","type":"Toolbar"},{"attributes":{"source":{"id":"46397"}},"id":"46587","type":"CDSView"},{"attributes":{"line_alpha":0.1,"line_color":"#4c4b4c","line_width":2,"x":{"field":"time"},"y":{"field":"cN_Kd"}},"id":"46584","type":"Line"},{"attributes":{"line_color":"#d8534f","line_width":2,"x":{"field":"time"},"y":{"field":"nu"}},"id":"46595","type":"Line"},{"attributes":{"line_alpha":0.1,"line_color":"#d8534f","line_width":2,"x":{"field":"time"},"y":{"field":"nu"}},"id":"46596","type":"Line"},{"attributes":{"line_alpha":0.2,"line_color":"#d8534f","line_width":2,"x":{"field":"time"},"y":{"field":"nu"}},"id":"46597","type":"Line"},{"attributes":{},"id":"46544","type":"LinearScale"},{"attributes":{"args":{"Kd_cAA_slider":{"id":"46401"},"Kd_cN_slider":{"id":"46402"},"cN_slider":{"id":"46404"},"gamma_slider":{"id":"46399"},"nu_slider":{"id":"46400"},"omega_slider":{"id":"46403"},"phiR_slider":{"id":"46398"},"source":{"id":"46397"}},"code":"// Define constants\nconst M0 = 0.01 * 1.5E17;\nconst cAA_0 = 1E-3;\n\n// Parse the slider inputs\nlet phi_R = phiR_slider.value;\nlet gamma_max = gamma_slider.value;\nlet nu_max = nu_slider.value;\nlet Kd_cAA = Math.pow(10, Kd_cAA_slider.value);\nlet Kd_cN = Math.pow(10, Kd_cN_slider.value);\nlet cN = Math.pow(10, cN_slider.value);\nlet omega = Math.pow(10, omega_slider.value);\n\n// Parse the data inputs\nlet data = source.data;\n\n// Given the inputs, set initial conditions and instantiate params and arg\nlet MR_0 = phi_R * M0;\nlet MP_0 = (1 - phi_R) * M0;\nlet cN_0 = cN;\nlet params = [MR_0, MP_0, cAA_0, cN_0];\nlet args = [gamma_max, nu_max, omega, phi_R, Kd_cAA, Kd_cN];\n\n// Get the time range and peform integration\nlet time = data['time'];\nlet dynamics = odeintForwardEuler(batchCultureSelfReplicator, params, args, 0.001, time.length);\n\n\n// Update the source\nfor (let i=0; i &lt; time.length; i++ ) {\n    data['rel_M'][i] = (dynamics[i][0] + dynamics[i][1]) / M0;\n    data['cAA_Kd'][i] = dynamics[i][2] / Kd_cAA;\n    data['cN_Kd'][i] = dynamics[i][3] / Kd_cN;\n    data['gamma'][i] = dynamics[i][2] / (dynamics[i][2] + Kd_cAA);\n    data['nu'][i] = dynamics[i][3] / (dynamics[i][3] + Kd_cN);\n}\nsource.change.emit()\n\n// console.log(dynamics[0][0], dynamics[0][1], dynamics[0][0] + dynamics[0][1]);\n\n// Functions\nfunction batchCultureSelfReplicator(params,args, dt) { \n    let [Mr, Mp, cAA, cN] = params;\n    let [gamma_max, nu_max, omega, phi_R, Kd_cAA, Kd_cN] = args;\n\n    // Compute the transalational efficiency\n    let gamma = gamma_max * (cAA / (cAA + Kd_cAA));\n    let nu = nu_max * (cN / (cN + Kd_cN));\n\n    // Define the biomass dynamics\n    let dM_dt = gamma * Mr;\n    \n    // Define allocation dynamics\n    let dMr_dt = phi_R * dM_dt;\n    let dMp_dt = (1 - phi_R) * dM_dt;\n\n    // Define precursor dynamics\n    let dcAA_dt = (nu * Mp - dM_dt * (1 + cAA)) / (Mr + Mp);\n\n    // Define nutrient dynamics\n    let dcN_dt = -nu * Mp / omega;\n    return [dMr_dt * dt, dMp_dt * dt, dcAA_dt * dt, dcN_dt * dt]\n}\n\nfunction odeintForwardEuler(fun, params, args, dt, nSteps) { \n    let out = [params]; \n    for (let i=1; i &lt; nSteps ; i++) { \n        let deriv = fun(out[i-1], args, dt)\n        for (let j=0; j &lt; deriv.length; j++) {\n            deriv[j] = out[i-1][j] + deriv[j];\n        }\n        out.push(deriv);\n    }\n    return out\n}\n\n\nfunction odeintMidpointMethod(fun, params, args, dt, nSteps){\n    let out = [params];\n    for (let i=1; i &lt; nSteps; i++) {\n        let k1 = fun(out[i-1], args, dt);\n        for (let j=1; j &lt; k1.length; j++) {\n            k1[j] = out[i-1][j] + (k1[j] /2);\n        }\n        let k2 = fun(k1, args, dt/2);\n        for (let j=1; j &lt; k1.length; j++) {\n            k2[j] = out[i-1][j] + k2[j];\n        }\n        out.push(k2)\n    }\n    return out\n}\n\nfunction odeintRK4(fun, params, args, dt, nSteps) { \n        let out = [params];\n        for (let i=1; i &lt; nSteps; i++) { \n            let k1 = fun(out[i-1], args, dt);\n            let k2 = fun(out[i-1] + k1/2, args, dt/2);\n            let k3 = fun(out[i-1] + k2/2, args, dt/2);\n            let k4 = fun(out[i-1] + k3, args, dt);\n            let deriv = out[i-1] + dt * (k1 + 2*k2 + 2 * k3 + k4)/6;\n            out.push(deriv);\n        }\n        return out\n}\n"},"id":"46600","type":"CustomJS"},{"attributes":{"source":{"id":"46397"}},"id":"46599","type":"CDSView"},{"attributes":{"children":[[{"id":"46398"},0,0],[{"id":"46401"},0,1],[{"id":"46399"},1,0],[{"id":"46402"},1,1],[{"id":"46400"},2,0],[{"id":"46403"},2,1],[{"id":"46404"},3,0]]},"id":"46615","type":"GridBox"},{"attributes":{"children":[[{"id":"46618"},0,0],[{"id":"46405"},1,0],[{"id":"46619"},2,0],[{"id":"46620"},3,0]]},"id":"46674","type":"GridBox"},{"attributes":{"data":{"M":{"__ndarray__":"AACn3PdQFUMvS1dmBlIVQxygAuMlVBVDq4jjqBVXFUNxgOj2qloVQ45VMNbHXhVDP6YWXVZjFUOkcG72RWgVQz5w6rqJbRVD0MaOaRdzFUM9HLm05ngVQypAH8jwfhVDA1fK8i+FFUO/WxZmn4sVQ7B1jQo7khVD9lmSW/+YFUO8dJlM6Z8VQ68UPDT2phVDGU3cuyOuFUPKThnTb7UVQ8nRjqLYvBVDGPxVh1zEFUPtMLYI+ssVQ0Ze/dOv0xVD2D//tnzbFUP6kbmbX+MVQ6KenYVX6xVDyRDVjWPzFUNUP0bhgvsVQ1oDm760AxZDPXn4cvgLFkMUT8NZTRQWQ4SkjNuyHBZDJUMaayglFkMDD22GrS0WQ8J10LNBNhZDDPGFguQ+FkNDUCaJlUcWQ6eANmVUUBZDWQXTuiBZFkOkjZAz+mEWQwxJvX7gahZDm4FIUNNzFkOqiQ5h0nwWQ8l12G3dhRZD1YrPNvSOFkNMWzKAFpgWQ3Ao+xFEoRZDp+CdtnyqFkP6wWk7wLMWQ0oP9nAOvRZDOfvqKWfGFkNELh07ys8WQ0kJAXw32RZDhYLuxa7iFkMEVfbzL+wW
